import React from 'react';

function Pagination({ currentPage, totalPages, onPageChange }) {
  const renderPageNumbers = () => {
    const pageNumbers = [];

    // Calculate the previous and next page numbers
    const prevPage = currentPage > 1 ? currentPage - 1 : null;
    const nextPage = currentPage < totalPages ? currentPage + 1 : null;

    // Render the previous page number
    if (prevPage !== null) {
      pageNumbers.push(
        <li key={prevPage}>
          <button onClick={() => onPageChange(prevPage)}>{prevPage}</button>
        </li>
      );
    }

    // Render the current page number
    pageNumbers.push(
      <li key={currentPage} className="active">
        <button>{currentPage}</button>
      </li>
    );

    // Render the next page number
    if (nextPage !== null) {
      pageNumbers.push(
        <li key={nextPage}>
          <button onClick={() => onPageChange(nextPage)}>{nextPage}</button>
        </li>
      );
    }

    return pageNumbers;
  };

  return (
    <ul className="pagination">
      <li>
        <button onClick={() => onPageChange(currentPage - 1)} disabled={currentPage === 1}>
          Previous
        </button>
      </li>
      {renderPageNumbers()}
      <li>
        <button onClick={() => onPageChange(currentPage + 1)} disabled={currentPage === totalPages}>
          Next
        </button>
      </li>
    </ul>
  );
}

export default Pagination;
